#include <stdio.h>

int main()
{
    int N;
    int prevrten_broj=0;
    scanf("%d",&N);
    for(int i=0;i<N;i++){
        int X;
        scanf("%d",&X);
        prevrten_broj = 0;
        for(int j=X;j>0;j/=10){
            int cifra=j%10;
            prevrten_broj=(prevrten_broj*10)+cifra;
        }
        if(X == prevrten_broj){
            printf("Brojot e palindrom\n");
        }
        else {
            printf("Brojot ne e polindrom\n");
        }
    }
    return 0;
}
